      bmCross: {
        background: '#bdc3c7'
      },
      bmMenuWrap: {
        position: 'fixed',
        height: '100%'
      },
      bmMenu: {
        background: 'white',
        padding: '2.5em 1.5em 0',
        fontSize: '1.15em'
      },
      bmMorphShape: {
        fill: 'white'
      },
      bmItemList: {
        color: 'white',
        padding: '0.8em'
      },
      bmItem: {
        display: 'inline-block'
      },
      bmOverlay: {
        background: 'rgba(0, 0, 0, 0.3)'
      }
    }




    const classes = useStyles()
    return(


<div key="header">
<div key="topInfo"  className={classes.topInfo}>
<p className={classes.fontFaceGm}>Tech In With Ella</p>


<Menu styles={ styles } >
<a id="home" className="menu-item" href="/">Home</a>
